import React, { Component } from 'react';
import './css/experience.css';
import ExperienceComp from './addComp/experienceAdd';


class Experience extends Component {
    constructor() {
        super();
    }

    render() {

        return (
            <div id="experience">
                <div id="headingwrap">
                    <div id="heading">WORK EXPERIENCE</div>
                    <button id="addExp">+</button>
                </div>


                <ExperienceComp title="front-end engineer"
                desc="at Google, working with React"
                since="2020"
                to="2022"
                where="London,UK"></ExperienceComp>

            </div>
        )
    }
}

export default Experience
